import React, { useState } from "react";
import Course from "./Course"
const AllCourse = ()=>
{
    const[courses,setCourses] = useState([
        {title:"Java Course",description:"This is demo course"},
        {title:"Django Course",description:"This is demo course"},
        {title:"Python Course",description:"This is demo course"},
        {title:"React Course",description:"This is demo course"}


    ])
    return(
        <div>

            <h2>All Courses</h2>
            <p>List of courses are as follows</p>

            {

                courses.length>0?courses.map((item)=><Course course = {item}/>):"No Item Found"
            }
        </div>
    )
}
export default AllCourse;
